import React, { Component } from 'react'

class NovoAnuncio extends Component {

  render () {

    return (

      <div className="container" style={{paddingTop: '120px'}}>
              <h1>Novo Anuncio</h1>
      </div>
    )
  }


}

export default NovoAnuncio
